                    <div class="texto_servicio">


                        <div class="texto mostrar texto1">
                            <h3><span class="color">P1: </span>Legal</h3>
                            <p>
                                El staff Abogados, contadores, especializados en diversos campos para el sector Empresarial Peruano e Inversión Extranjera.
                                Nuestro objetivo es dar información precisa en aplicación a las normas comerciales vigente, contemplando asuntos societarios y contractuales para resolver las necesidades y requerimientos legales de manera oportuna.
                            </p>
                            <ul class="li_servicios">
                                <li>Asesoría Legal</li>
                                <li>Servicios Legales</li>
                            </ul>
                            <a class="pru"  href="servicios.html">Ver Servicio</a>
                        </div>


                        <div class="texto texto2">
                            <h3><span class="color">P2: </span>Tributaria</h3>
                            <p>
                                El staff de Contadores, especialistas, todos ellos en diversos campos para el sector Empresarial Peruano e Inversión Extranjera.
                                <br>
                                Nuestro objetivo es brindar solución ante las contingencias presentadas por los cambios en las Normas Tributarias orientado al sector empresarial según detalle:
                            </p>
                            <ul class="li_servicios">
                                <li>Consultas tributarias</li>
                                <li>Problemática fiscal </li>
                                <li>Cumplimiento de las Normas Tributarias</li>
                            </ul>
                            <p class="mover_texto"> Lo anterior mediante la atención personalizada ya sea entidades privadas, nacionales o extranjeras, cualquiera sea su régimen tributario</p>

                            <a class="pru"  href="servicios.html">Ver Servicio</a>
                        </div>


                        <div class="texto texto3">
                            <h3><span class="color">P3: </span>Laboral</h3>
                            <p>
                                Contadores, Abogados Laboralistas, trabajamos en equipo, especialistas de gran experiencia en derecho laboral y de la seguridad social, los cuales, nos dedicamos al asesoramiento en diversas cuestiones de dicho ámbito, tanto a personas físicas como a empresas:
                            </p>
                            <ul class="li_servicios">
                                <li> Manejo de nóminas </li>
                                <li> Indemnizaciones </li>
                                <li> Informes sobre Consultas específicas </li>
                            </ul>
                            <p class="mover_texto">
                                Lo anterior mediante la atención personalizada ya sea entidades privadas, nacionales o extranjeras, cualquiera sea su régimen Laboral.
                            </p>
                            <a class="pru"  href="servicios.html">Ver Servicio</a>
                        </div>


                        <div class="texto texto4">
                            <h3><span class="color">P4: </span>Administracion</h3>
                            <p>
                                Administradores, especialistas Evaluamos y asesoramos a empresas que buscan mayor eficiencia Y eficacia en el correcto uso de sus recursos humanos, llevado todo ello a un sistema de organización que cubre todas las etapas de la administración, en una estructura simple, dinámica y actual a nuestros tiempos.
                            </p>
                            <ul class="li_servicios">
                                <li>Reducción de Procesos Inútiles y repetidos</li>
                                <li>Optimización de procedimientos administrativos y organizativos.</li>
                                <li>Disponer de herramientas de gestión que garanticen una correcta toma de decisiones.</li>
                                <li>Análisis y optimización de recursos propios poco utilizados por falta de formación o de tiempo.</li>
                                <li>Diseño e implementación de las actividades y funciones administrativas y operativas.</li>
                                <li>Diseño e implementación de las políticas, normas y procedimientos.</li>
                                <li>Diseño e implementación de formatos de control administrativo.</li>
                            </ul>
                            <a class="pru"  href="servicios.html">Ver Servicio</a>
                        </div>


                        <div class="texto texto5">
                            <h3><span class="color">P5: </span>Financiera</h3>
                            <p>
                                El área financiera es una pieza fundamental para el desarrollo y sustentabilidad de cualquier negocio.
                            </p>
                            <p>
                                Por ellos es habitual ver que los emprendedores y pymes se concentran en "qué", "cómo" y "para quién" producir o desarrollar el producto/servicio antes de pensar en asuntos financieros; sin embargo las finanzas es una de las áreas más importantes para que el negocio siga en marcha.
                            </p>
                            <ul class="li_servicios">
                                <li>Registrar operaciones contables y datos financieros,</li>
                                <li>Planificar, analizar y evaluar la información registrada.</li>
                                <li>Buscar fuentes de financiamiento y seleccionar la más conveniente para el emprendimiento</li>
                                <li>Buscar opciones de inversión con las que pueda contar el negocio</li>
                                <li>Controlar las operaciones ejecutadas</li>
                                <li>Flujos Proyectados</li>
                            </ul>
                            <a class="pru"  href="servicios.html">Ver Servicio</a>
                        </div>


                        <div class="texto texto6">
                            <h3><span class="color">P6: </span>Sistema de calidad</h3>
                            <p>
                                Un Sistema de Gestión de Calidad es una herramienta que le permite a cualquier organización planear, ejecutar y controlar las actividades necesarias para el desarrollo de la misión, a través de la prestación de servicios con altos estándares de calidad, los cuales son medidos a través de los indicadores de satisfacción de los usuarios
                            </p>
                            <ul class="li_servicios">
                                <li>Sistema de Calidad SIGEMype.</li>
                                <li>Sistemas de calidad ISO</li>
                                <li>SST: sistema de Seguridad y Salud /SUNAFIL /</li>
                                <li>Homologaciones</li>
                            </ul>
                            <a class="pru"  href="servicios.html">Ver Servicio</a>
                        </div>


                        <div class="texto texto7">
                            <h3><span class="color">P7: </span>T.I tecnología de la Información.</h3>
                            <p>
                                Nuestro servicio de Mantenimiento informativo, tiene como objetivo evitar las posibles incidencias que puedas surgir y en caso de que se produzcan solucionarlas rápidamente de forma que tanto los equipos como los datos que estos custodian, estén siempre a salvo. Todo con especialistas de calidad, finalmente velamos por su tranquilidad y la continuidad de sus negocios.
                            </p>
                            <ul class="li_servicios">
                                <li>Soporte Remoto </li>
                                <li>Configuración de redes </li>
                                <li>BK de datos </li>
                                <li>Cableado Estructurado </li>
                                <li>Diagnostico </li>
                            </ul>
                            <a class="pru" href="servicios.html">Ver Servicio</a>
                        </div>


                        <div class="texto texto8">
                            <h3><span class="color">P8: </span>Comercio Exterior </h3>
                            <p>
                                El staff de especialistas en comercio internacional de alta trayectoria, el auge del comercio exterior del Perú es uno de los tantos factores que influyen en el crecimiento económico del país, las pequeñas y medianas empresas están en el incremento tanto de exportaciones como importaciones, preparados así para cubrir las expectativas para contribuir con su crecimiento.
